"use strict";Vue.component("v-header",{template:'\n    <div class="v-header">\n      <div class="label">{{label}}</div>\n      <div class="btn">\n        <slot>\n          <a class="active">全市信用综合分析平台</a>\n          <a>重点人群重点行业分析</a>\n          <a>专项应用分析</a>\n        </slot>\n      </div>\n      <div class="date">{{date}}</div>\n    </div>',props:{label:{type:String,default:"主标题"}},data:function(){return{date:""}},created:function(){var a=new Date,t=a.getFullYear(),e=a.getMonth()+1,n=a.getDate();this.date="".concat(t,"年").concat(e,"月").concat(n,"号")}});